import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Error from 'pages/Error';
import { MainPage } from './pages/MainPage';

const App = () => {
	return (
		<Switch>
			<Route exact={true} path="/">
				<MainPage />
			</Route>

			<Route path="*">
				<Error />
			</Route>
		</Switch>
	);
};

export default App;
